const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Acceuil />} />
          <Route path="/films" element={<Films />} />
          <Route path="/series" element={<Series />} />
          <Route path="/nouveautes" element={<Nouveautes />} />
          <Route path="*" element={<Acceuil />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
